print("=== Finding all E. coli K-12 strains ===\n")

# Query for all taxa that are children of K-12 (83333) or MG1655 (511145)
k12_strains_query = """
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?taxon ?name
WHERE {
  {
    # K-12 itself
    VALUES ?taxon { taxon:83333 taxon:511145 }
    OPTIONAL { ?taxon up:scientificName ?name }
  }
  UNION
  {
    # Children of K-12
    ?taxon rdfs:subClassOf* taxon:83333 .
    OPTIONAL { ?taxon up:scientificName ?name }
  }
  UNION
  {
    # Children of MG1655
    ?taxon rdfs:subClassOf* taxon:511145 .
    OPTIONAL { ?taxon up:scientificName ?name }
  }
}
"""

